import React from "react";

const card = ({ inputHandeler }) => {
  return (
    <div>
      <label name=" palindrome ">
        Input text to check if it is a palindrome
      </label>
      <input id="palindrome " type="text" onChange={inputHandeler} />
    </div>
  );
};

export default card;
